import React from 'react';
import Sdata from './Sdata';
import Card from './Card';


const App = () => { 

  return (
  <>

      {Sdata.map((val,index) => {
        return(
          <Card
        key={val.id}
        imgsrc={val.imgsrc}
        title={val.title}
        sname={val.sname}
        link={val.links}    
       />
        );
      })}
</>
  )
};

export default App;
